import React from "react";
import styled from "styled-components";
import { useState, useEffect } from "react";

import Stopwatch from "../components/timers/Stopwatch";
import Countdown from "../components/timers/Countdown";
import XY from "../components/timers/XY";
import Tabata from "../components/timers/Tabata";
import StopCount from "../components/selectors/StopCount";

const Selectors = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Selector = styled.div`
  border: 1px solid gray;
  padding: 20px;
  margin: 10px;
  font-size: 1.5rem;
`;

const SelectorTitle = styled.div``;


const AddView = () => {

  const selectors = [
    { title: "Stopwatch", C: <TwoInput /> },
    { title: "Countdown", C: <TwoInput /> },
  ];

  return (
    <Selectors>
      {selectors.map((selectors) => (
        <Selector key={`timer-${selectors.title}`}>
          <SelectorTitle>{selectors.title}</SelectorTitle>
          {selectors.C}
        </Selector>
      ))}
    </Selectors>
  );
};

export default AddView;
